import React from 'react';
import './Merchants.scss';
import merchantLandingBG from '../../assets/images/merchant-title-bg.png'

class Merchants extends React.Component {
  render() {
    const pageDescription = "Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore";
    const approach = "Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore. Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore";
    const methods = [
      {
        name: "Semi-structured Interviews",
        desc: "Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore."
      },
      {
        name: "Super-Merchant Interview",
        desc: "Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore."
      },
      {
        name: "Interpretation Session",
        desc: "Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore."
      },
      {
        name: "Persona",
        desc: "Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore."
      }
    ];

    return (
      <div className="merchant-research-page">
        <div className="landing-title">
          <img src={merchantLandingBG} className="landing-background" alt="merchant interview" />
          <div className="page-name">Learn from Merchants</div>
          <div className="page-desc">{pageDescription}</div>
        </div>

        <div className="approach">
          <div className="approach-title">Our approach</div>
          <div className="approach-content">{approach}</div>
          <div className="methods">
            <div className="methods-list">
              {methods.map((method, index) => {
                return (
                  <div key={"method" + index} className="method">
                    <div className="method-number">{index + 1}.</div>
                    <div className="method-title">{method.name}</div>
                    <div className="method-desc">{method.desc}</div>
                  </div>
                )
              })}
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Merchants;
